Text:
Noyabrın 3-də “Gənclik” stansiyasının yaxınlığında yerləşən Tofiq Bəhramov adına stadionunda UEFA Avropa Liqası turnirinin qrup mərhələsi çərçivəsində “Qarabağ” FK-nın keçirəcəyi oyunla əlaqədar Bakı metropoliteninin iş rejimində dəyişikliklər ediləcək.
@FKQarabagh 

