📣Elektrik dispetçeri vəzifəsi üzrə hazırlıq kursuna qəbul var.
Tələb:
👉mühəndis-elektrik ixtisası üzrə ali təhsil;
👉24-35 yaş arası kişi və qadınlar;
👉hərbi bilet (kişi namizədlər üçün yararlılıq kateqoriyası ilə);
👉 1 il+ iş təcrübəsi olanlara üstünlük veriləcək https://t.co/04pV5WLkPK

Yay qrafikinin iş günləri cədvəlinə edilmiş əlavəyə uyğun olaraq, hər iş günü aşağıda qeyd edilən istiqamətlərdə qatarların hərəkəti təşkil olunacaq:
▪️ 06:40-da - “Nərimanov” stansiyasından “Bakmil” stansiyasına;
